import React, { Component } from 'react';
import search from '../../assets/icons/search-solid.svg';

class Footer extends Component {
    render() {
        return (
            <div className='footer'>
                <p className = 'footer__text'>FAQ - PERGUNTAS FREQUENTES</p>
                <div className='footer__div2'>
                <input type='text' placeholder='Busque por termo...'></input>
                    <a className='footer__busca'>
                    <input className='footer__img' type='image' src={search}></input>
                    <p className='footer__text2'>buscar</p>
                    </a>
                </div>
            </div>
        );
    }
}
export default Footer;
